class Room{constructor(n,t,i){this.id=n;this.creatorId=t;this.currentUserId=i}}class Message{constructor(n,t,i){this.userName=n;this.userId=t;this.text=i}}class Error{constructor(n,t){this.caption=n;this.message=t}}window.ZokuChat.chat={};window.ZokuChat.chat.room=null;window.ZokuChat.chat.connection=(new signalR.HubConnectionBuilder).withUrl("/chatHub").build();window.ZokuChat.chat.connection.on("ReceiveMessages",function(n){window.ZokuChat.chat.app.messages.push(n)});window.ZokuChat.chat.connection.on("ReceiveMessage",function(n,t,i){window.ZokuChat.chat.app.messages.push(new Message(n,t,i))});window.ZokuChat.chat.connection.on("ReceiveError",function(n,t){window.ZokuChat.chat.app.errors.push(n,t)});window.ZokuChat.chat.app=new Vue({el:"#chat-app",data:{messages:[],errors:[]},methods:{startHub:function(){window.ZokuChat.chat.connection.start().catch(function(n){return console.error(n.toString())}).then(function(){window.ZokuChat.chat.connection.invoke("JoinRoom",window.ZokuChat.chat.room.id).catch(function(n){return console.error(n.toString())})}).then(function(){window.ZokuChat.chat.connection.invoke("GetMessages",window.ZokuChat.chat.room.id).catch(function(n){return console.error(n.toString())})})},sendMessage:function(n){window.ZokuChat.chat.connection.invoke("SendMessage",window.ZokuChat.chat.room.id,n).catch(function(n){return console.error(n.toString())})}}});